import React from 'react';

import UserData from '../../UserData/UserData';
import Cars from '../Cars/Cars';
import CarInfo from '../Cars/CarInfo';
import CarServices from '../Cars/CarServices';
import Img from '../UI/Img/Img';
import Card from '../UI/Card/Card';
import Wrapper from '../UI/Wrapper/Wrapper';

import classes from './Garage.module.css';
import garageImage from '../../assets/Awesome-garage.jfif';

const Garage = (props) => {

  const users = JSON.parse(UserData);

  const cars = users.filter((user) => {
    if (user.email === 'zaryooo@gmail.com') {
      console.log(user);
      return user;
    } 
  }).map((user) => user.cars);

  return (
    <Wrapper>
      <Img src={garageImage} alt="Awesome garage" />
      <Card className={classes.garage}>
        <Cars userCars={cars} />
        <CarInfo />
        <CarServices />
      </Card>
    </Wrapper>
  );
};

export default Garage;
